import NavigationElement from "./NavigationElement";

const NavigationContainer = () => {
  return (
    <div>
      <NavigationElement name="ABOUT" />
      <NavigationElement name="EXPERIENCES" />
      <NavigationElement name="PROJECTS" />
    </div>
  );
};

export default NavigationContainer;
